import React from "react";
import "./demographic.css";
import map from "./map4.png";

export default function Demographics(){
	return(
		<div className="demographic_container">
		<div className="demograph1">
			<h1>Demographics & Acknowledgements</h1>
			<p>{"This survey encompasses a total of 210 countries and covers statistics such as Fatality Ratio, Global Rank etc. Thanks for visiting."}</p>
			
		</div>
		<div className="demograph2">
		<h2>Your Country</h2>
		<img alt="map" src={map}/>
		</div>
		</div>
		);
}
